import React from 'react';

const MobileCard = ({ mobile }) => {
  return (
    <div className="col-md-4 mb-4">
      <div className="card">
        <img src={mobile.imageUrl} className="card-img-top" alt={mobile.name} />
        <div className="card-body">
          <h5 className="card-title">{mobile.name}</h5>
          <p className="card-text">Price: ${mobile.price}</p>
          <a href={mobile.link} target="_blank" rel="noopener noreferrer" className="btn btn-secondary">
            View Product
          </a>
        </div>
      </div>
    </div>
  );
};

export default MobileCard;
